import React, { useState, useEffect } from 'react';

const BudgetEditor = ({ patient, initialBudget, onSaveBudget }) => {
  const [form, setForm] = useState({
    nombreCompleto: '',
    rut: '',
    telefono: '',
    email: '',
    fecha: new Date().toISOString().split('T')[0],
    estado: 'pendiente',
    items: [],
    dientes: []
  });

  useEffect(() => {
    if (patient) {
      setForm(prev => ({
        ...prev,
        nombreCompleto: `${patient.nombre} ${patient.apellido || ''}`,
        rut: patient.rut || '',
        telefono: patient.telefono || '',
        email: patient.email || ''
      }));
    }
    if (initialBudget) {
      setForm(initialBudget);
    }
  }, [patient, initialBudget]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  const handleAddItem = () => {
    setForm(prev => ({
      ...prev,
      items: [...prev.items, { descripcion: '', precio: 0, cantidad: 1, subtotal: 0 }]
    }));
  };

  const handleItemChange = (index, field, value) => {
    const newItems = [...form.items];
    newItems[index][field] = field === 'precio' || field === 'cantidad' ? parseInt(value) || 0 : value;
    newItems[index].subtotal = newItems[index].precio * newItems[index].cantidad;
    setForm(prev => ({ ...prev, items: newItems }));
  };

  const handleAddDiente = () => {
    const diente = prompt('Ingrese nÃºmero de diente (ej: 11, 36)');
    if (diente) {
      setForm(prev => ({
        ...prev,
        dientes: [...new Set([...prev.dientes, parseInt(diente)])]
      }));
    }
  };

  const aceptarPresupuesto = async () => {
    const existe = await fetch(`/api/pacientes?rut=${form.rut}`).then(r => r.json());
    let pacienteId = existe.length ? existe[0]._id : null;

    if (!pacienteId) {
      const nuevoPaciente = {
        nombre: form.nombreCompleto,
        rut: form.rut,
        telefono: form.telefono,
        email: form.email
      };
      const res = await fetch('/api/pacientes', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(nuevoPaciente)
      });
      const data = await res.json();
      pacienteId = data._id;
    }

    if (form.dientes.length) {
      await fetch(`/api/pacientes/${pacienteId}/odontograma`, {
        method: 'PATCH',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          odontograma: form.dientes.map(d => ({ diente: d, estado: 'presupuestado' }))
        })
      });
    }

    onSaveBudget({ ...form, estado: 'aprobado', pacienteId });
  };

  const total = form.items.reduce((sum, item) => sum + item.subtotal, 0);

  return (
    <div className="bg-white p-6 rounded-xl shadow-md space-y-4">
      <h3 className="text-xl font-bold">Editor de Presupuesto</h3>
      <input name="nombreCompleto" value={form.nombreCompleto} onChange={handleChange} placeholder="Nombre Completo" className="w-full border p-2 rounded" />
      <input name="rut" value={form.rut} onChange={handleChange} placeholder="RUT" className="w-full border p-2 rounded" />
      <input name="telefono" value={form.telefono} onChange={handleChange} placeholder="TelÃ©fono" className="w-full border p-2 rounded" />
      <input name="email" value={form.email} onChange={handleChange} placeholder="Email" className="w-full border p-2 rounded" />

      <div className="flex justify-between">
        <span>Fecha: {form.fecha}</span>
        <button onClick={handleAddItem} className="text-blue-600">â Agregar Item</button>
        <button onClick={handleAddDiente} className="text-blue-600">â Diente</button>
      </div>

      {form.items.map((item, i) => (
        <div key={i} className="grid grid-cols-4 gap-2">
          <input placeholder="DescripciÃ³n" value={item.descripcion} onChange={e => handleItemChange(i, 'descripcion', e.target.value)} className="border p-2 rounded" />
          <input type="number" placeholder="Precio" value={item.precio} onChange={e => handleItemChange(i, 'precio', e.target.value)} className="border p-2 rounded" />
          <input type="number" placeholder="Cantidad" value={item.cantidad} onChange={e => handleItemChange(i, 'cantidad', e.target.value)} className="border p-2 rounded" />
          <input readOnly value={`$${item.subtotal}`} className="border p-2 rounded bg-gray-100" />
        </div>
      ))}

      <div className="font-semibold text-right">Total: ${total.toLocaleString()}</div>

      <div className="flex justify-end space-x-2">
        <button onClick={aceptarPresupuesto} className="px-4 py-2 bg-green-600 text-white rounded hover:bg-green-700">Aceptar y Registrar</button>
        <button onClick={() => onSaveBudget(form)} className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700">Guardar</button>
      </div>
    </div>
  );
};

export default BudgetEditor;
